package com.zhzx.dao.model.common;import com.zhzx.dao.model.BaseModel;public class LogLoginModel extends BaseModel {		/**	*	*/	private String id;		/**	*	*/	private String custNo;		/**	*用户ID	*/	private String userId;		/**	*客户端（1:pc，2:andriod，3:iphone）	*/	private String client;		/**	*	*/	private String ip;		/**	*	*/	private String mobile;		/**	*	*/	private String flag;		/**	*	*/	private String createtime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getCustNo() {	    return this.custNo;	}	public void setCustNo(String custNo) {	    this.custNo=custNo;	}	public String getUserId() {	    return this.userId;	}	public void setUserId(String userId) {	    this.userId=userId;	}	public String getClient() {	    return this.client;	}	public void setClient(String client) {	    this.client=client;	}	public String getIp() {	    return this.ip;	}	public void setIp(String ip) {	    this.ip=ip;	}	public String getMobile() {	    return this.mobile;	}	public void setMobile(String mobile) {	    this.mobile=mobile;	}	public String getFlag() {	    return this.flag;	}	public void setFlag(String flag) {	    this.flag=flag;	}	public String getCreatetime() {	    return this.createtime;	}	public void setCreatetime(String createtime) {	    this.createtime=createtime;	}	}